import classes from "./AvaMeals.module.css";
import Card from "../ui/Card";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    description: "American, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
  },
];

function AvailableMeals() {
    
    function Prikaz(props){
        return (<li>
        <div>
        <h3 className={classes.meal}>{props.name}</h3>
        <div className={classes.description}>{props.description}</div>
        <div className={classes.price}>{props.price}</div>
        </div>
        <div></div>
        </li>)
    }
    
    function lista() {
    const blabla = DUMMY_MEALS.map((meal) => <Prikaz key={meal.id} name={meal.name} description={meal.description} price={meal.price} />);
    }

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{lista}</ul>
      </Card>
    </section>
  );
}

export default AvailableMeals;
